import React, { useEffect, useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Dimensions,
  Animated,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { Ionicons } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';
import { useApp } from '../context/AppContext';
import { mockStocks } from '../data/mockData';

const { width } = Dimensions.get('window');

const HomeScreen = () => {
  const navigation = useNavigation();
  const { state, dispatch } = useApp();
  const [fadeAnim] = useState(new Animated.Value(0));

  useEffect(() => {
    // Load mock data
    dispatch({ type: 'SET_STOCKS', payload: mockStocks });
    
    Animated.timing(fadeAnim, {
      toValue: 1,
      duration: 800,
      useNativeDriver: true,
    }).start();
  }, []);

  const handleStockPress = (stock: any) => {
    dispatch({ type: 'SET_CURRENT_STOCK', payload: stock });
    navigation.navigate('StockDetail' as never);
  };

  const renderStockCard = (stock: any, index: number) => (
    <Animated.View
      key={stock.symbol}
      style={[
        styles.stockCard,
        {
          opacity: fadeAnim,
          transform: [
            {
              translateY: fadeAnim.interpolate({
                inputRange: [0, 1],
                outputRange: [50, 0],
              }),
            },
          ],
        },
      ]}
    >
      <TouchableOpacity
        style={styles.stockCardContent}
        onPress={() => handleStockPress(stock)}
        activeOpacity={0.8}
      >
        <View style={styles.stockHeader}>
          <View style={styles.stockIcon}>
            <Text style={styles.stockIconText}>
              {stock.symbol.slice(0, 2)}
            </Text>
          </View>
          <View style={styles.stockInfo}>
            <Text style={styles.stockSymbol}>{stock.symbol}</Text>
            <Text style={styles.stockName}>{stock.name}</Text>
          </View>
          <View style={styles.stockPrice}>
            <Text style={styles.priceText}>${stock.price.toFixed(2)}</Text>
            <View
              style={[
                styles.changeContainer,
                {
                  backgroundColor:
                    stock.changePercent >= 0
                      ? 'rgba(16, 185, 129, 0.2)'
                      : 'rgba(239, 68, 68, 0.2)',
                },
              ]}
            >
              <Ionicons
                name={stock.changePercent >= 0 ? 'trending-up' : 'trending-down'}
                size={12}
                color={stock.changePercent >= 0 ? '#10b981' : '#ef4444'}
              />
              <Text
                style={[
                  styles.changeText,
                  {
                    color: stock.changePercent >= 0 ? '#10b981' : '#ef4444',
                  },
                ]}
              >
                {stock.changePercent >= 0 ? '+' : ''}
                {stock.changePercent.toFixed(2)}%
              </Text>
            </View>
          </View>
        </View>
        
        <View style={styles.matchContainer}>
          <Text style={styles.matchLabel}>Match</Text>
          <Text style={styles.matchPercentage}>{stock.matchPercentage}%</Text>
        </View>
      </TouchableOpacity>
    </Animated.View>
  );

  return (
    <ScrollView style={styles.container} showsVerticalScrollIndicator={false}>
      {/* Header */}
      <View style={styles.header}>
        <Text style={styles.greeting}>Welcome back!</Text>
        <Text style={styles.subtitle}>Discover your next investment</Text>
      </View>

      {/* Portfolio Summary */}
      <View style={styles.portfolioCard}>
        <LinearGradient
          colors={['rgba(0, 212, 255, 0.1)', 'rgba(139, 92, 246, 0.1)']}
          style={styles.portfolioGradient}
        >
          <Text style={styles.portfolioTitle}>Portfolio Value</Text>
          <Text style={styles.portfolioValue}>$12,450.67</Text>
          <View style={styles.portfolioChange}>
            <Ionicons name="trending-up" size={16} color="#10b981" />
            <Text style={styles.portfolioChangeText}>+$234.12 (1.92%)</Text>
          </View>
        </LinearGradient>
      </View>

      {/* Recommended Stocks */}
      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Recommended for You</Text>
        <Text style={styles.sectionSubtitle}>
          Based on your investment preferences
        </Text>
      </View>

      {state.stocks.map((stock, index) => renderStockCard(stock, index))}

      {/* Quick Actions */}
      <View style={styles.quickActions}>
        <TouchableOpacity style={styles.actionButton}>
          <Ionicons name="add-circle" size={24} color="#00d4ff" />
          <Text style={styles.actionText}>Add Stock</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.actionButton}>
          <Ionicons name="analytics" size={24} color="#8b5cf6" />
          <Text style={styles.actionText}>Analytics</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.actionButton}>
          <Ionicons name="notifications" size={24} color="#10b981" />
          <Text style={styles.actionText}>Alerts</Text>
        </TouchableOpacity>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#0f0f23',
  },
  header: {
    paddingTop: 60,
    paddingHorizontal: 20,
    paddingBottom: 20,
  },
  greeting: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: 5,
  },
  subtitle: {
    fontSize: 16,
    color: '#8b9dc3',
  },
  portfolioCard: {
    marginHorizontal: 20,
    marginBottom: 30,
    borderRadius: 16,
    overflow: 'hidden',
  },
  portfolioGradient: {
    padding: 20,
    borderRadius: 16,
    borderWidth: 1,
    borderColor: 'rgba(0, 212, 255, 0.2)',
  },
  portfolioTitle: {
    fontSize: 14,
    color: '#8b9dc3',
    marginBottom: 5,
  },
  portfolioValue: {
    fontSize: 32,
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: 10,
  },
  portfolioChange: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  portfolioChangeText: {
    fontSize: 14,
    color: '#10b981',
    marginLeft: 5,
  },
  section: {
    paddingHorizontal: 20,
    marginBottom: 20,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: 5,
  },
  sectionSubtitle: {
    fontSize: 14,
    color: '#8b9dc3',
  },
  stockCard: {
    marginHorizontal: 20,
    marginBottom: 15,
    borderRadius: 12,
    backgroundColor: 'rgba(26, 26, 46, 0.8)',
    borderWidth: 1,
    borderColor: 'rgba(139, 157, 195, 0.1)',
  },
  stockCardContent: {
    padding: 16,
  },
  stockHeader: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 12,
  },
  stockIcon: {
    width: 40,
    height: 40,
    borderRadius: 20,
    backgroundColor: 'rgba(0, 212, 255, 0.2)',
    justifyContent: 'center',
    alignItems: 'center',
    marginRight: 12,
  },
  stockIconText: {
    fontSize: 14,
    fontWeight: 'bold',
    color: '#00d4ff',
  },
  stockInfo: {
    flex: 1,
  },
  stockSymbol: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#ffffff',
  },
  stockName: {
    fontSize: 12,
    color: '#8b9dc3',
  },
  stockPrice: {
    alignItems: 'flex-end',
  },
  priceText: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: 4,
  },
  changeContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    paddingHorizontal: 8,
    paddingVertical: 4,
    borderRadius: 8,
  },
  changeText: {
    fontSize: 12,
    fontWeight: '600',
    marginLeft: 4,
  },
  matchContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  matchLabel: {
    fontSize: 12,
    color: '#8b9dc3',
  },
  matchPercentage: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#00d4ff',
  },
  quickActions: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    paddingHorizontal: 20,
    paddingVertical: 20,
    marginBottom: 20,
  },
  actionButton: {
    alignItems: 'center',
    padding: 16,
    borderRadius: 12,
    backgroundColor: 'rgba(26, 26, 46, 0.8)',
    borderWidth: 1,
    borderColor: 'rgba(139, 157, 195, 0.1)',
    minWidth: 80,
  },
  actionText: {
    fontSize: 12,
    color: '#8b9dc3',
    marginTop: 8,
